import React from 'react';
import { NavLink } from 'react-router-dom';


const Navigation = () => {
    return (
        <div>
            <h1>Friends</h1>
            <div>
                <NavLink to="/">Home</NavLink>
            </div>
            <div>
                <NavLink to="/newFriend">New</NavLink>
            </div>     
        </div> 
    );
}

export default Navigation;
